import Footer from "./Footer/Footer";
import Header from "./Header/Header";
import NavbarMenu from "./navbar/Navbar";

const LayoutWeb = ({children})=>{
    return(
        <>
            <Header/>
            <NavbarMenu/>
            {children}
            <Footer/>
        </>
    )
}

export default LayoutWeb;
